// reducer.js
import { ADD_START_DATE, ADD_END_DATE } from './actions';

const initialState = {
  startDate: '',
  endDate: '',
  // другие состояния
};

const dataReducer = (state = initialState, action) => {
  switch (action.type) {
    case ADD_START_DATE:
      return {
        ...state,
        startDate: action.payload
      };
    case ADD_END_DATE:
      return {
        ...state,
        endDate: action.payload
      };
    // другие случаи
    default:
      return state;
  }
};

export default dataReducer;
